import axios from 'axios';

const endpoint = `${process.env.REACT_APP_SERVER_SERVICE}/api/friends`;

export const getFriends = async (id) => {
    try {
        const response = await axios.get(`${endpoint}/${id}`);
        return response.data;
    } catch (error) {
        console.error(error);
    }
}
